import React from "react";
import "./nav.css";

function Nav() {
  return (
    <div className="nav">
      <h2>Trending</h2>
      <h2>Top Rated</h2>
      <h2>Actions</h2>
      <h2>Comedy</h2>
      <h2>Horror</h2>
      <h2>Romance</h2>
      <h2>Mystery</h2>
      <h2>Sci-Fi</h2>
      <h2>Western</h2>
      <h2>Animation</h2>
      <h2>Tv Movie</h2>
    </div>
  );
}

export default Nav;
